import React, { Component } from 'react'
import SignUp from '../Auth/SignUp'

export default class Home extends Component {
    constructor(props) {
        super(props);

    }
    render() {
        return (
            <div>
                <h2>Status: {this.props.loggedInStatus}</h2>
                <SignUp />
            </div>
        )
    }
}
